import React, { useState } from 'react';
import '../index.css';
import logo from '../assets/inflight-logo.png';
import PieChartFood from './PieChartFood';
import PieChartBeverage from './PieChartBeverage';
import RouteLineChart from './RouteLineChart';
import BarChartComponent from './BarChartComponent';
import DetailPage from './DetailPage';

const Dashboard = () => {
  const [selectedRoute, setSelectedRoute] = useState('NYC-LAX');
  const [showRouteDetails, setShowRouteDetails] = useState(false);

  const handleFilterClick = () => {
    setShowRouteDetails(true);
  };

  const handleRouteClick = (route) => {
    setSelectedRoute(route);
    setShowRouteDetails(true);
  };

  return (
    <div className="dashboard-container">
      {/* Header */}
      <div className="header">
        <div className="logo-title">
          <img src={logo} alt="In-Flight Insights Logo" className="dashboard-logo" />
          <h1>‚úàÔ∏è In-Flight Insights Dashboard</h1>
        </div>
        <div className="nav-links">
          <a href="#">Dashboard</a>
          <a href="#">Reports</a>
          <a href="#">Settings</a>
          <a href="#">Profile</a>
        </div>
      </div>

      {/* KPI Section */}
      <div className="kpi-section">
        <div className="kpi-card">
          <h3>üí∞ Cost Savings</h3>
          <p>$1.2M</p>
        </div>
        <div className="kpi-card">
          <h3>‚ôªÔ∏è Waste Saved</h3>
          <p>210 kg</p>
        </div>
        <div className="kpi-card">
          <h3>‚úàÔ∏è Routes Analyzed</h3>
          <p>350</p>
        </div>
        <div className="kpi-card">
          <h3>üåç CO‚ÇÇ Saved</h3>
          <p>28 tonnes</p>
        </div>
      </div>

      {/* Filter Buttons */}
      <div className="route-filter-section">
        <select value={selectedRoute} onChange={(e) => setSelectedRoute(e.target.value)}>
          <option value="NYC-LAX">NYC-LAX</option>
          <option value="SEA-JFK">SEA-JFK</option>
          <option value="ATL-PHX">ATL-PHX</option>
        </select>
        <button onClick={handleFilterClick}>Filter by Flight Route</button>
      </div>

      {/* Chart Panels */}
      <div className="chart-grid">
        <div className="chart-card">
          <h2>Consumption Breakdown</h2>
          <div className="dual-pie">
            <div>
              <h4>Food</h4>
              <PieChartFood />
            </div>
            <div>
              <h4>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        <div className="chart-card">
          <h2>Waste Trend</h2>
          <RouteLineChart onRouteClick={handleRouteClick} />
          {showRouteDetails && <DetailPage selectedRoute={selectedRoute} />}
        </div>
      </div>

      {/* Bar Chart */}
      <div className="bar-chart-container">
        <BarChartComponent />
      </div>
    </div>
  );
};

export default Dashboard;
